import React from 'react';
import TextField from '@mui/material/TextField';

const InputField = ({ value, onChange, type = 'text' }) => {
  return (
    <TextField
      type={type}
      value={value}
      onChange={onChange}
      fullWidth
      variant="outlined"
      size="small"
    />
  );
};

export default InputField;
